import React from "react";

const Home = () => {
    return(
        <div style={{display:'flex', justifyContent:'center', gap:'50px', alignItems:'center', backgroundSize:'cover', height:'100vh'}}>
            <div style={{backgroundColor:'green'}}>
                <p style={{ fontSize:'60px'}}>Welcome</p>
                <div style={{width:'2px', height:'100%', backgroundColor:'red'}}/>
                <div style={{ display:'flex', flexDirection:'column'}}>
                    <span style={{ fontSize:'36px',}}>Digital Portfolio Project Search</span>
                    <span>This website contains each of my project's deployments or demonstrations.</span>
                    <span>Visit the links above to view my projects.</span>
                </div>
            </div>
        </div>
    );
} 
export default Home;
